;; Note: You will need to implement CheckIntersect!!!

IntersectWrapper PROC USES ebx ecx one:PTR SPRITE, two:PTR SPRITE
	mov ebx, one
	mov ecx, two
	invoke CheckIntersect, (SPRITE PTR [ebx]).x, (SPRITE PTR [ebx]).y, (SPRITE PTR [ebx]).obj, (SPRITE PTR [ecx]).x, (SPRITE PTR [ecx]).y, (SPRITE PTR [ecx]).obj
	ret
IntersectWrapper ENDP

CheckIntersect PROC USES ebx ecx edi esi oneX:DWORD, oneY:DWORD, oneBitmap:PTR EECS205BITMAP, twoX:DWORD, twoY:DWORD, twoBitmap:PTR EECS205BITMAP
	; compute one's right and left bounds
	; computer two's right and left bounds
	; if one's left > two's right, no intersect
	; if two's left > one's right, no intersect
	mov ebx, oneBitmap
	mov ebx, (EECS205BITMAP PTR [ebx]).dwWidth
	sar ebx, 1
	mov ecx, oneX
	sub ecx, ebx  ; ecx <- oneX - width/2, one's left
	add ebx, oneX ; ebx <- oneX + width/2, one's right

	mov edi, twoBitmap
	mov edi, (EECS205BITMAP PTR [edi]).dwWidth
	sar edi, 1
	mov esi, twoX
	sub esi, edi  ; esi <- twoX - width/2, two's left
	add edi, twoX ; edi <- twoX + width/2, two's right

	cmp ecx, edi ; one's left, two's right
	jg no_intersect
	cmp esi, ebx ; two's left, one's right
	jg no_intersect

	; compute one's top and bottom
	; compute two's top and bottom
	; if one's top < two's bottom, no intersect
	; if two's top < one's bottom, no intersect
	mov ebx, oneBitmap
	mov ebx, (EECS205BITMAP PTR [ebx]).dwHeight
	sar ebx, 1
	mov ecx, oneY
	sub ecx, ebx  ; ecx <- oneY - height/2, one's bottom
	add ebx, oneY ; ebx <- oneY + height/2, one's top

	mov edi, twoBitmap
	mov edi, (EECS205BITMAP PTR [edi]).dwHeight
	sar edi, 1
	mov esi, twoY
	sub esi, edi  ; esi <- twoY - height/2, two's bottom
	add edi, twoY ; edi <- twoY + height/2, two's top

	cmp ebx, esi ; one's top, two's bottom
	jl no_intersect
	cmp edi, ecx ; two's top, one's bottom
	jl no_intersect
	
	; if none of those, they must be intersecting
	mov eax, 1
	ret
	
no_intersect:
	mov eax, 0
	ret
okay:
	ret
CheckIntersect ENDP

FillScreenColor PROC USES ebx ecx color:BYTE
	xor ebx, ebx
	jmp x_cond
x_body:
	; here begins x body
	xor ecx, ecx
	jmp y_cond
y_body:
	; here begins y body
	invoke DrawPixel, ebx, ecx, color
	inc ecx
	; here ends y body
y_cond:
	cmp ecx, 480
	jl y_body
	inc ebx
	; here ends x body
x_cond:
	cmp ebx, 640
	jl x_body
	ret
FillScreenColor ENDP

MoveByClick PROC USES esi ecx ebx edx ship:PTR SPRITE
	mov esi, ship
	; invoke RotateBlit, (SPRITE PTR [esi]).obj, (SPRITE PTR [esi]).x, (SPRITE PTR [esi]).y, (SPRITE PTR [esi]).theta
	add (SPRITE PTR [esi]).theta, 800h
	mov ecx, MouseStatus.buttons
	cmp ecx, MK_LBUTTON
	jne no_move
	mov ebx, MouseStatus.horiz
	mov (SPRITE PTR [esi]).x, ebx
	mov edx, MouseStatus.vert
	mov (SPRITE PTR [esi]).y, edx
no_move:
	invoke RotateBlit, (SPRITE PTR [esi]).obj, (SPRITE PTR [esi]).x, (SPRITE PTR [esi]).y, (SPRITE PTR [esi]).theta
	ret
MoveByClick ENDP

MoveByArrows PROC USES ebx ecx edx esi edi qqc:PTR SPRITE
	mov ecx, qqc
	mov ebx, KeyDown
	cmp ebx, VK_UP
	jne go_right
	dec (SPRITE PTR [ecx]).y
go_right:
	cmp ebx, VK_RIGHT
	jne go_down
	inc (SPRITE PTR [ecx]).x
go_down:
	cmp ebx, VK_DOWN
	jne go_left
	inc (SPRITE PTR [ecx]).y
go_left:
	cmp ebx, VK_LEFT
	jne no_move
	dec (SPRITE PTR [ecx]).x
no_move:
	ret
MoveByArrows ENDP

GameInit PROC USES ecx
	invoke FillScreenColor, 0ffh
	
	ret         ;; Do not delete this line!!!
GameInit ENDP

GamePlay PROC USES ecx ebx edx edi esi
	invoke FillScreenColor, BACKGROUND_COLOR
	;mov ecx, offset HELEN
	;invoke RotateBlit, (SPRITE PTR [ecx]).obj, (SPRITE PTR [ecx]).x, (SPRITE PTR [ecx]).y, (SPRITE PTR [ecx]).theta
	
	mov ecx, offset SALT
	invoke RotateBlit, (SPRITE PTR [ecx]).obj, (SPRITE PTR [ecx]).x, (SPRITE PTR [ecx]).y, (SPRITE PTR [ecx]).theta
	

	invoke MoveByClick, offset TIE_FIGHT
	invoke MoveByArrows, offset SALT
	invoke IntersectWrapper, offset TIE_FIGHT, offset SALT
	cmp eax, 0
	je no_intersect
	mov BACKGROUND_COLOR, 11100011b
no_intersect:
	ret         ;; Do not delete this line!!!
GamePlay ENDP

